	<style>
		@import url('/meta/css/type.css');

		* {
			box-sizing: border-box;
		}

		body {
			font-size: 1.2em;
			margin: 0;
			padding: 2em;
			font-family: 'museo-sans', sans-serif;
			font-weight: 300;
			background: linear-gradient(0deg, rgba(26, 151, 152, 1) 0%, #C0FFEE 100%);
			background-repeat: no-repeat;
			background-attachment: fixed;
			height: 100%;
		}

		div {
			margin: 1em;
		}

		main {
			display: block;
			max-width: 30em;
			border-radius: 1em;
			margin: 0 auto;
			text-align: center;
			background: rgba(255, 255, 255, .5);
			padding: 2em;
		}

		h1 {
			margin: 0;
		}

		h2 {
			font-weight: normal;
			margin: 0;
		}

		#name {
			font-family: 'museo-sans-rounded', sans-serif;
		}

		#pfp {
			max-width: 10em;
			margin: auto;
			color: #555;
			margin-bottom: 1em;
		}

		#pfp img {
			border: 10px solid #ccc;
			border-radius: 100%;
			width: 10em;
			height: 10em;
		}

		#pronouns {
			margin: 0;
			font-weight: 400;
			color: #666;
		}

		#location {
			display: inline-block;
		}

		#occupation {
			display: inline-block;
		}

		#bio {
			font-size: 120%;
			border-bottom: 1px solid #666;
			margin-top: .5em;
			padding-bottom: 1.5em;
			margin-bottom: 1.5em;
		}

		#footer {
			margin: 0;
			margin-top: 5em;
			font-size: 90%;
			font-weight: 300;
			color: #555;
		}

		#footer a:link,
		#footer a:visited,
		#footer a:hover,
		#footer a:active {
			color: #555;
			text-decoration: none;
			border: 0;
		}

		#footer .fa-plug {
			transform: rotate(0deg);
			transition: all 0.3s ease;
		}

		#footer:hover .fa-plug {
			transform: rotate(90deg);
			transition: all 0.3s ease;
		}

		ul {
			text-align: left;
		}

		li {
			line-height: 170%;
		}

		a:link,
		a:visited {
			color: #000;
			text-decoration-color: #555;
			text-decoration: none;
			border-bottom: 1px dotted #000;
		}

		a:hover,
		a:active {
			color: #000;
			text-decoration-color: #000;
			text-decoration: none;
			border-bottom: 2px solid #000;
		}

		#key {
			display: inline-block;
			font-family: 'fira-mono';
			font-size: .7em;
			line-height: 1.1em;
			color: #333;

		}

		@media (max-width: 500px) {
			body {
				font-size: 1em;
				padding: 1em;
			}

			main {
				padding-top: 1em;
			}
		}
	</style>
